import PropTypes from 'prop-types';
import Configuration from './Configuration/Configuration';
import NewConfiguration from './NewConfiguration/NewConfiguration';
import { useState } from 'react';
import EditConfiguration from './EditConfiguration/EditConfiguration';
import CreateConfigurationModal from './NewConfigurationModal.js/CreateConfigurationModal';

import useModal from '../../hooks/useModal';
import useDrawer from '../../hooks/useDrawer';

const Configurations = props => {
    const [isEditDrawer, openEditDrawer, closeEditDrawer] = useDrawer();

    const [
        isNewConfigurationModalVisible,
        showNewConfigurationModal,
        hideNewConfigurationModal,
        onOkNewConfigurationModal,
        onCancelNewConfigurationModal,
    ] = useModal();

    return (
        <>
            <div className='px-6 py-10 flex flex-wrap gap-6'>
                <Configuration
                    name={'Configuration 1'}
                    description={'Nat config'}
                    text={"Today's New's Source, MGT"}
                    openEditDrawer={openEditDrawer}
                />
                <Configuration
                    name={'Configuration 2'}
                    description={'Nat config 2'}
                    text={"Today's New's Source"}
                    openEditDrawer={openEditDrawer}
                />
                <Configuration
                    name={'Configuration 2'}
                    description={'Nat config 3'}
                    text={"Today's New's Source"}
                    openEditDrawer={openEditDrawer}
                />
                <NewConfiguration showNewConfigurationModal={showNewConfigurationModal} />
            </div>

            <EditConfiguration isEditDrawer={isEditDrawer} closeEditDrawer={closeEditDrawer} />

            <CreateConfigurationModal
                isNewConfigurationModalVisible={isNewConfigurationModalVisible}
                showNewConfigurationModal={showNewConfigurationModal}
                hideNewConfigurationModal={hideNewConfigurationModal}
                onOkNewConfigurationModal={onOkNewConfigurationModal}
                onCancelNewConfigurationModal={onCancelNewConfigurationModal}
            />
        </>
    );
};

Configurations.propTypes = {};

export default Configurations;
